def getResults(searchTerm: String, page: Int): Iterable[String] = {
  println(searchTerm, page)

  import java.net._
  import java.util._
  import java.io._
  import javax.net.ssl.HttpsURLConnection
  import com.google.gson.Gson
  import com.google.gson.GsonBuilder
  import com.google.gson.JsonObject
  import com.google.gson.JsonParser

  val subscriptionKey = "90d32ad783f84d8ebef3d9914d958407";
  val host = "https://api.cognitive.microsoft.com";
  val path = "/bing/v7.0/images/search";

  val url = new URL(host + path + "?offset=" + ((page - 1) * 150) + "&count=150&q=" +  URLEncoder.encode(searchTerm, "UTF-8"))
  val connection = url.openConnection()
  connection.setRequestProperty("Ocp-Apim-Subscription-Key", subscriptionKey)

  import scala.collection.JavaConversions._

  val stream = connection.getInputStream();
  val response = new Scanner(stream).useDelimiter("\\A").next()

  val headers = connection.getHeaderFields();

  stream.close();
  val parser = new JsonParser();
  val json = parser.parse(response).getAsJsonObject();
  val total = Integer.parseInt(json.get("totalEstimatedMatches").getAsString());
  val pages = total / 150 - 1
  val results = json.getAsJsonArray("value");

  val next: Iterable[String] = {
    if ( (page + 1) < pages ) {
      println("Fetching page " + (page + 1 ))

      getResults(searchTerm, page + 1)
    } else {
      println("Completed @ " + page )
      Seq()
    }
  }

  results.map(
    _.asInstanceOf[JsonObject]
  ).map(
    _.get("thumbnailUrl").getAsString()
  ) ++ next
}

